function splitLinks(s, i) {
    if (i.match(/\[.*\]/)) {
        console.log(i)
        fin = new RegExp("(.+\\n?){1," + i.slice(1, -1) + "}", "g");
        temp1 = s.match(fin);
        return "[\n" + JSON.stringify(temp1.map(function(j, i) {
            return j.trim().split("\n");
        }), null, "\t") + "\n]";

    } else {
        fin = new RegExp("(.+\\n?){1," + i + "}", "g");
        temp1 = s.match(fin);
        return JSON.stringify(temp1.map(function(j, i) {
            return j.trim().split("\n");
        }), null, "\t");
    }
}

        new RegExp("([^?=&]+)(=([^&]*))?", "g"),

    return objURL;
